package com.bw.test.myapplication.com;import java.io.Serializable;import java.util.List;public class Bean implements Serializable{	private static final long serialVersionUID = 1218682723L;	private boolean status;	private long total;	private List<Tngou> tngou;	public boolean getStatus() {		return this.status;	}	public void setStatus(boolean status) {		this.status = status;	}	public long getTotal() {		return this.total;	}	public void setTotal(long total) {		this.total = total;	}	public List<Tngou> getTngou() {		return this.tngou;	}	public void setTngou(List<Tngou> tngou) {		this.tngou = tngou;	}	public Bean() {}	public Bean(boolean status, long total, List<Tngou> tngou){		super();		this.status = status;		this.total = total;		this.tngou = tngou;	}	public String toString() {		return "Bean [status = " + status + ", total = " + total + ", tngou = " + tngou + "]";	}}